// カメラ用データ
// *************************************
var camera;
var canvas;
var copy_count = 0;

$(function(){
    // video 内 camera
    camera = $("#camera").get(0);

    // *************************************
    // 最新 API
    // *************************************
    if ( navigator.mediaDevices ) {
        console.log("navigator.mediaDevices");

        navigator.mediaDevices.getUserMedia({video: true})
        .then(function(stream){
            camera.srcObject = stream;
        })
        .catch(function(err){
            // ブラウザで使用を拒否した場合
            options.error(err.name);
        });
    }

    // *************************************
    // 旧 API
    // *************************************
    else {
        console.log("navigator.getUserMedia");

        // 旧 WebRTCチェック用
        var api = [
            "webkitGetUserMedia", "mozGetUserMedia","msGetUserMedia"
        ]
        $.each(api,function(idx){
            if (navigator.getUserMedia = navigator.getUserMedia || navigator[api[idx]]) {
                return false;
            }
        });
        // WebRTC 使用可能
        if ( navigator.getUserMedia ) {
            // カメラの表示
            navigator.getUserMedia({video: true},
            function(stream) {
                camera.src = window.URL.createObjectURL(stream);
            },
            function(err){
                // ブラウザで使用を拒否した場合
                options.error(err.name);
            });     
        }
        else {
            //options.cerror("WebRTC を使用できません");
            options.error("WebRTC is not available");
        }
    }

    // *************************************
    // canvas にコピーして画像に変換
    // *************************************
    $("#copy").on( "click", function(){

        copy_count++;
        if ( copy_count > 1 ) {
            //options.error("撮影は1枚までです");
            options.error("Only one image can be created at a time");
            return false;
        }

        var canvas = document.getElementById("canvas");         
        //jQueryバージョン
        //canvas = $("#canvas").get(0);

        var ctx = canvas.getContext('2d');

        ctx.drawImage(camera, 0, 0, canvas.width, canvas.height);

        //javascriptバージョン（safari対応する）
        var images = document.getElementById("images");
        var img = document.createElement("img");
        img.setAttribute("src", canvas.toDataURL("image/jpeg"));
        img.setAttribute("id", "image"+ copy_count);
        images.appendChild(img);

        //jQueryバージョン（safari対応しない）
        /*
        $("<img>").appendTo("#images")
        .prop( {"src": canvas.toDataURL("image/jpeg"), "id": "image"+ copy_count} );
        */
    });

    // *************************************
    // アップロード処理
    // *************************************
    $("#frm").submit( function(event){
        // 本来の送信処理はキャンセル
        event.preventDefault();

        if ( $("#images").html() === "" ) {
            //options.error("撮影を行い、アップロードする画像を作成して下さい");
            options.error("No image available");
            return;
        }

        $("fieldset").eq(0).prop("disabled", true);

        // エラーメッセージエリアをクリア
        $(".error").next().text( "" );

        // 結果の表示エリアを全てクリア
        $("#result").html( "" );


        // **************************************
        // ファイルのアップロード
        // **************************************
        //console.log("アップロード処理開始");

        var formData = new FormData();

        // テストの為、約100K の制限
        formData.append("MAX_FILE_SIZE", 100000);

        var file_cnt = 0;

            var base64 = $("#images img").prop("src");
            var bin = atob(base64.split(',')[1]);
            var buffer = new Uint8Array(bin.length);
            for (var i = 0; i < bin.length; i++) {
            buffer[i] = bin.charCodeAt(i);
            }
            var blob = new Blob([buffer.buffer], {type: "image/jpeg"});

            file_cnt++;
            var file_name = (new Date()).getTime();
            formData.append("image"+file_cnt, blob, file_name +"_"+file_cnt+".jpg");

        formData.append("FILE_COUNT", file_cnt );
        $.ajax({
            url: "/vr/result",
            type: "POST",
            data: formData,
            timeout: 30000, //単位はミリ秒
            processData: false,  // jQuery がデータを処理しないよう指定
            contentType: false   // jQuery が contentType を設定しないよう指定
        })
        //成功時の処理
        .done(function( data, textStatus ){
            console.log( "status:" + textStatus );
            console.log( "data:" + JSON.stringify(data, null, "    ") );
            $("fieldset").eq(0).prop("disabled", false);
            //options.info("アップロード処理が完了しました");
            options.info("Upload suceeded");

            // アップロード結果の表示

            if ( data !== null ) {
                var data_obj = JSON.parse(data);
                var min_obj = data_obj.images[0].faces[0].age.min;
                var min_str = JSON.stringify(min_obj);
                var max_obj = data_obj.images[0].faces[0].age.max;
                var max_str = JSON.stringify(max_obj);
                var age_score_obj = data_obj.images[0].faces[0].age.score;
                var age_score_str = JSON.stringify(age_score_obj);
                var gender_obj = data_obj.images[0].faces[0].gender.gender;
                var gender_str = JSON.stringify(gender_obj).replace(/"/g,'');
                var gender_score_obj = data_obj.images[0].faces[0].gender.score;
                var gender_score_str = JSON.stringify(gender_score_obj);

                $("#result").append("<br><b>Age</b><table><tr><th>Max</th><th>Min</th><th>Score</th></tr><tr><td>" + max_str + "</td><td>" + min_str + "</td><td>" + age_score_str + "</td></tr></table>");
                $("#result").append("<br><b>Gender</b><table><tr><th>Gender</th><th>Score</th></tr><tr><td>" + gender_str + "</td><td>" + gender_score_str + "</td></tr></table>")
            }
            else{
                 $("#result").append("<p>No result</p>");
            }
        })

        //失敗時の処理
        .fail(function(jqXHR, textStatus, errorThrown ){
            console.log( "status:" + textStatus );
            console.log( "errorThrown:" + errorThrown );
            //options.info("アップロードに失敗しました");
            options.error("Upload failed");
            })
            .always(function() {

            // 操作不可を解除
            $("fieldset").eq(0).prop("disabled", false);
        });

    });

    // **************************************
    // mmenu
    // **************************************
    $("#mmenu_left").mmenu({
        offCanvas: {
            position  : "left",
            zposition : "next"
        }
    });
});

